import Register from "./Register";
import PostList from "./PostList";

function App() {
  return (
<BrowserRouter>
{/* <Home/> */}
<Routes>
  <Route>

  <Route path="/" element={<Home />} />
  <Route path="/signup" component={<Register/>} />
  <Route path="/posts" component={<PostList/>} />
  <Route/>
  </Route>
</Routes>

</BrowserRouter>
  );
}

export default App;
